import React from 'react';
import { Homepage } from './components/Homepage';
import './App.scss';

function App() {
  return (
    <div className="App">
      <section>
        {<img src="./photos/brand.svg" alt="brand logo" className="brand-logo" />}
        <Homepage />
      </section>
    </div>
  );
}

export default App;
